package net.perfectdreams.spicymorenitta.routes

import kotlinx.html.audio
import kotlinx.html.div
import kotlinx.html.dom.append
import kotlinx.html.id
import kotlinx.html.js.*
import kotlinx.html.style
import kotlinx.serialization.ImplicitReflectionSerializer
import kotlinx.serialization.Serializable
import kotlinx.serialization.json.JSON
import kotlinx.serialization.parseList
import net.perfectdreams.spicymorenitta.SpicyMorenitta
import net.perfectdreams.spicymorenitta.application.ApplicationCall
import net.perfectdreams.spicymorenitta.utils.select
import org.w3c.dom.*
import kotlin.browser.document

class AudioRecordingRoute(val m: SpicyMorenitta) : BaseRoute("/audio/{guildid}/{timestamp}") {
    @UseExperimental(ImplicitReflectionSerializer::class)
    override fun onRender(call: ApplicationCall) {
        super.onRender(call)

        println("f1")
        val trackedData = JSON.nonstrict.parseList<TrackedAudioData>(TEST_DATA)
                .sortedBy { it.at }
        println("f2")

        val startOffset = trackedData.first().at

        val cachedUserData = mutableListOf(
                TestUserData(
                        123170274651668480,
                        "MrPowerGamerBR",
                        "https://cdn.discordapp.com/avatars/123170274651668480/a_f5edb8f69836651dddefd0a722816f08.gif?size=2048"
                ),
                TestUserData(
                        422839753923362827,
                        "Coffee",
                        "https://cdn.discordapp.com/avatars/422839753923362827/54ef08b1a4155e18b069d70154c768d0.png?size=2048"
                ),
                TestUserData(
                        347064573318135811,
                        "!!๖ۣۜFüFū Fuuf ッ",
                        "https://cdn.discordapp.com/avatars/347064573318135811/280aa125f9be40a41ffed62d0ae93340.png?size=2048"
                ),
                TestUserData(
                        310877707175198720,
                        "JGS",
                        "https://cdn.discordapp.com/avatars/310877707175198720/e07401b216a846bbac933f4b2e6db2a5.png?size=2048"
                ),
                TestUserData(
                        168759625875718145,
                        "nitro.",
                        "https://cdn.discordapp.com/avatars/168759625875718145/2af145d8e49fde48bb27ebe1d051ebd7.png?size=2048"
                ),
                TestUserData(
                        416056545051279370,
                        "Robodoki",
                        "https://cdn.discordapp.com/avatars/416056545051279370/3c5714decd88b4f11bd3f801cc41495e.png?size=2048"
                ),
                TestUserData(
                        489572594555813888,
                        "Red Br",
                        "https://cdn.discordapp.com/avatars/489572594555813888/a_07949f6034085b4d19da47ec96b91582.gif?size=2048"
                ),
                TestUserData(
                        332918506930831362,
                        "Rannii",
                        "https://cdn.discordapp.com/avatars/332918506930831362/a_9c1d5acece8e6b87c69717c71d3cfa83.gif?size=2048"
                ),
                TestUserData(
                        335193454034419715,
                        "! N1  ᵃᵏᵗ",
                        "https://cdn.discordapp.com/avatars/335193454034419715/c0026cc6b2b2fc5e4d6908239da530b6.png?size=2048"
                )
        )
        val correctData = mutableListOf<TrackedAudioDataWithLengths>()

        val up = mutableListOf<TrackedAudioData>()

        for (data in trackedData) {
            if (data.state == "up") {
                up.add(
                        data
                )
            } else {
                val storedData = up.firstOrNull { data.id == it.id }

                if (storedData != null) {
                    up.remove(storedData)
                    correctData.add(
                            TrackedAudioDataWithLengths(
                                    storedData.id,
                                    storedData.at - startOffset,
                                    data.at - storedData.at
                            )
                    )
                }
            }
        }

        // data generated, yay!
        debug("Generated ${correctData.size} audio tracks")

        val audioRecorderWrapper = document.select<HTMLDivElement>("#audio-recorder-wrapper")

        audioRecorderWrapper.append {
            div {
                id = "audio-preview"
                style = "text-align: center;"

                for (uniqueId in correctData.map { it.id }.distinct()) {
                    val userData = cachedUserData.first { it.id == uniqueId }
                    img(src = userData.avatarUrl) {
                        width = "128"
                        attributes["data-talking-id"] = "$uniqueId"
                        style = "border: 4px solid transparent; margin: 8px; border-radius: 100%;"
                    }
                }
            }

            audio {
                id = "audio"
                controls = true
                attributes["preload"] = "metadata"

                source {
                    src = "https://cdn.discordapp.com/attachments/393332226881880074/674257470839062550/297732013006389252-1580777446579.ogg"
                }

                onTimeUpdateFunction = {
                    val currentTime = document.select<HTMLAudioElement>("#audio").currentTime
                    document.select<HTMLDivElement>("#point").style.left = "${currentTime * 10}px"

                    val usersTalkingAtTheMoment = correctData.filter { (currentTime * 1000).toInt() in it.at..(it.at + it.length) }

                    document.querySelectorAll("[data-talking-id]").asList()
                            .forEach {
                                it as HTMLImageElement
                                it.style.borderColor = "transparent"
                            }

                    for (user in usersTalkingAtTheMoment) {
                        document.select<HTMLImageElement>("[data-talking-id='${user.id}']")
                                .style.borderColor = "#41aa7b"
                    }
                }
            }

            div {
                id = "scrobbler-wrapper"
                style = "overflow: auto;\n" +
                        "    background-color: #2f3136;\n" +
                        "    border-radius: 16px;\n" +
                        "    width: 95vw;\n" +
                        "    margin: auto;\n" +
                        "    padding: 8px;"

                table {
                    style = "height: 1px; width: 100%; white-space: nowrap;"

                    tr {
                        th {}
                        th {
                            this@table.div {
                                style = "position: relative;"

                                div {
                                    id = "point"
                                    style = "width: 1px; background-color: #f10202; height: 200px; top: 0px; position: absolute;     z-index: 999;"
                                }

                                div {
                                    id = "scrobbler-area"
                                }
                            }
                        }
                    }

                    for (uniqueId in correctData.map { it.id }.distinct()) {
                        tr {
                            td {
                                div {
                                    style = "display: flex; color: white; align-items: center;"

                                    val userData = cachedUserData.first { it.id == uniqueId }

                                    img(src = userData.avatarUrl) {
                                        style = "height: 24px; border-radius: 100%;"
                                    }

                                    + userData.name
                                }
                            }
                            td {
                                onDragFunction = {
                                    val target = it.target as HTMLElement

                                    var clientX = it.asDynamic().clientX
                                    var clientY = it.asDynamic().clientY

                                    var rect = target.getBoundingClientRect()
                                    var x = clientX - rect.left
                                    var y = clientY - rect.top

                                    println("x: $x; y: $y")
                                }

                                style = "position: relative; border-bottom: 1px solid #00000024;"

                                val userData = correctData.filter { it.id == uniqueId }
                                        .sortedBy(TrackedAudioDataWithLengths::at)

                                // Fill empty div before
                                // val firstOfThisUser = userData.first()
                                var previousData: TrackedAudioDataWithLengths? = null

                                div {
                                    style = "height: 100%;"

                                    userData.forEach {
                                        val currentPreviousData = previousData
                                        val silentAudioDataLength = if (currentPreviousData == null)
                                            it.at
                                        else {
                                            it.at - (currentPreviousData.at + currentPreviousData.length)
                                        }

                                        div {
                                            style = "background-color: transparent; height: 100%; display: inline-block; width: ${(silentAudioDataLength.toDouble() / 100)}px;"
                                        }

                                        previousData = it
                                        div {
                                            style = "background-color: #${intToRGB(it.id)}; height: 100%; display: inline-block; width: ${it.length.toDouble() / 100}px;"
                                        }
                                    }
                                }
                            }
                        }
                    }
                }
            }
        }
    }

    companion object {
        @Serializable
        class TrackedAudioData(
                // É deserializado para String pois JavaScript é burro e não funciona direito com Longs
                val id: Long,
                val state: String,
                val at: Long
        )

        class TrackedAudioDataWithLengths(
                val id: Long,
                val at: Long,
                val length: Long
        )

        class TestUserData(
                val id: Long,
                val name: String,
                val avatarUrl: String
        )

        fun intToRGB(id: Long): String {
            val c = (id and 0x00FFFFFF)
            .toString(16)
                    .toUpperCase();

            return "00000".substring(0, 6 - c.length) + c;
        }
    }

